sys_script_include.script:
/**
Query for obtaining the WS1UEMURLDisplay field
from the System Properties field.
**/
var WS1UEMURLDisplay = Class.create();
WS1UEMURLDisplay.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
    get_url_display:function() {
        var uem_url_display = gs.getProperty("x_vmw_ws1uem.WS1UEMURLDisplay");

        return uem_url_display;
    } ,
   _privateFunction: function() { // this function is not client callable
    }
 });
